TITLE:
  - The test case for Journal Bearing considered as Hard-EHL
  - example to see the effect of Pressure-dependent Viscosity
  - which has been implemented by two formulation of Barus
  - and Roeland which can be selected in material section
PROBLEM TYPE:
  PROBLEMTYPE: "Elastohydrodynamic_Lubrication"
DISCRETISATION:
  NUMSTRUCDIS: 0
  NUMALEDIS: 0
  NUMTHERMDIS: 0
STRUCTURAL DYNAMIC:
  DYNAMICTYPE: "Statics"
  TOLDISP: 0.01
  TOLRES: 0.01
  DIVERCONT: "continue"
  LINEAR_SOLVER: 3
LUBRICATION DYNAMIC:
  LINEAR_SOLVER: 3
  ABSTOLRES: 1e-07
  CONVTOL: 0.0001
  PENALTY_CAVITATION: 1e+08
ELASTO HYDRO DYNAMIC:
  NUMSTEP: 2
  MAXTIME: 400
  TIMESTEP: 0.0001
  ITEMAX: 500
  UNPROJ_ZERO_DBC: true
ELASTO HYDRO DYNAMIC/MONOLITHIC:
  CONVTOL: 0.0001
  TOLINC: 0.0001
  NORMCOMBI_RESFINC: "And"
  LINEAR_SOLVER: 3
CONTACT DYNAMIC:
  LINEAR_SOLVER: 3
  STRATEGY: "Ehl"
MORTAR COUPLING:
  SEARCH_PARAM: 1
  INTTYPE: "Elements"
MORTAR COUPLING/PARALLEL REDISTRIBUTION:
  PARALLEL_REDIST: "None"
SOLVER 3:
  SOLVER: "Superlu"
  NAME: "Direct_Solver"
MATERIALS:
  - MAT: 1
    MAT_ElastHyper:
      NUMMAT: 1
      MATIDS: [10]
      DENS: 7.85e-06
  - MAT: 10
    ELAST_CoupNeoHooke:
      YOUNG: 210000
      NUE: 0.3
  - MAT: 2
    MAT_lubrication:
      LUBRICATIONLAWID: 30
      DENSITY: 1
  - MAT: 30
    MAT_lubrication_law_barus:
      ABSViscosity: 5.7e-09
      PreVisCoeff: 0.0112
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "x*cos(250*t)-y*sin(250*t)-x"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "x*sin(250*t)+y*cos(250*t)-y"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
FUNCT2:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "-y*250"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "x*250"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
DESIGN POINT DIRICH CONDITIONS:
  - E: 1
    NUMDOF: 1
    ONOFF: [1]
    VAL: [0]
    FUNCT: [0]
DESIGN SURF DIRICH CONDITIONS:
  - E: 1
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [0, 0, 0]
    FUNCT: [0, 0, 0]
DESIGN VOL DIRICH CONDITIONS:
  - E: 2
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [1, 1, 0]
    FUNCT: [1, 1, 0]
DESIGN VOL INITIAL FIELD CONDITIONS:
  - E: 1
    FIELD: "Velocity"
    FUNCT: 2
DESIGN SURF EHL MORTAR COUPLING CONDITIONS 3D:
  - E: 2
    InterfaceID: 1
    Side: "Slave"
  - E: 3
    InterfaceID: 1
    Side: "Master"
